Gigantic (2008)  

Verenigde Staten
Komedie / Romantiek
99 minuten

geregisseerd door Mat Aselton
met Zooey Deschanel, Paul Dano en John Goodman

Brian (Paul Dano) is een jongeman die een rustig leventje leidt en werkt in een winkel. Op een dag ontmoet hij Happy (Zooey Deschanel) in zijn winkel en vanaf dat moment lijkt zijn hele leven om haar te draaien. Hij probeert met haar in contact te komen, maar dit gaat niet zo gemakkelijk...



